import React from "react";

function Navbar() {
  return (
    <nav className="navBar">
      <img
        className="navBar__logo"
        src="https://en.wikipedia.org/wiki/File:Amazon_logo.svg"
        alt="error"
      />
    </nav>
  );
}

export default Navbar;
